import React from "react";
import { 
    InfoText, 
    Card,
    CardSection,

} from "../../molecules";

import {
    Text,
    View,
    Icon,
    TouchableOpacity
} from "../../atoms";

import styles from "./styles";

const MyEventCard = ({
    onEventPress,
    
}) => {
    return (
        <View style={styles.container}>
            <InfoText>My Events</InfoText>
            <View
            style={{
                flexDirection: "row",
                justifyContent: "center",
                backgroundColor: "#eaeaea"
            }}
            >
                <TouchableOpacity onPress={onEventPress("On-Going")}>
                    <Card style={styles.eventStatusBox}>
                        <CardSection style={{ padding: 0 }}>
                            <Icon
                            name="calendar-clock"
                            type="material-community"
                            size={32}
                            color={"#F55C22"}
                            />
                        </CardSection>
                        <CardSection style={{ padding: 0 }}>
                            <Text style={styles.eventStatusText}>On-Going</Text>
                        </CardSection>
                    </Card>
                </TouchableOpacity>
                <TouchableOpacity onPress={onEventPress("Redeem")}>
                    <Card style={styles.eventStatusBox}>
                    <CardSection style={{ padding: 0 }}>
                        <Icon
                        name="email"
                        type="material-community"
                        size={32}
                        color={"#F55C22"}
                        />
                    </CardSection>
                    <CardSection style={{ padding: 0 }}>
                        <Text style={styles.eventStatusText}>Redeem</Text>
                    </CardSection>
                    </Card>
                </TouchableOpacity>
                <TouchableOpacity onPress={onEventPress("Redeemed")}>
                    <Card style={styles.eventStatusBox}>
                    <CardSection style={{ padding: 0 }}>
                        <Icon
                        name="email-check"
                        type="material-community"
                        size={32}
                        color={"#F55C22"}
                        />
                    </CardSection>
                    <CardSection style={{ padding: 0 }}>
                        <Text style={styles.eventStatusText}>Redeemed</Text>
                    </CardSection>
                    </Card>
                </TouchableOpacity>
                <TouchableOpacity onPress={onEventPress("Expired")}>
                    <Card style={styles.eventStatusBox}>
                    <CardSection style={{ padding: 0 }}>
                        <Icon
                        name="calendar-check"
                        type="material-community"
                        size={32}
                        color={"#F55C22"}
                        />
                    </CardSection>
                    <CardSection style={{ padding: 0 }}>
                        <Text style={styles.eventStatusText}>Expired</Text>
                    </CardSection>
                    </Card>
                </TouchableOpacity>
            </View>
        </View>
    );
};

export { MyEventCard };
